/* =====================================================
   UTILIDADES
===================================================== */

const ensureNumber = (value: any): number => {
  const num = Number(value);
  return isNaN(num) ? 0 : num;
};

const formatPrice = (value: any): string => {
  return `$${ensureNumber(value)
    .toFixed(2)
    .replace(/\B(?=(\d{3})+(?!\d))/g, ',')}`;
};

const truncateText = (text: string, max = 40): string =>
  !text ? '' : text.length > max ? text.slice(0, max) + '‚Ä¶' : text;

// üî• FUNCI√ìN MEJORADA: Obtener veh√≠culo unificado
const obtenerVehiculoUnificado = (factura: any): any => {
  // DEBUG: Mostrar qu√© datos llegan
  console.log('üìä Datos de factura para PDF:', {
    facturaId: factura?.id,
    tieneVehiculoDirecto: !!factura?.vehiculo,
    tieneOrdenVehiculo: !!factura?.orden?.vehiculo,
    vehiculoDirecto: factura?.vehiculo,
    vehiculoOrden: factura?.orden?.vehiculo,
    tieneVehiculoProp: factura?.vehiculo !== undefined,
    tieneOrdenProp: factura?.orden !== undefined
  });

  // PRIORIDAD 1: Veh√≠culo directo de la factura
  if (factura.vehiculo) {
    console.log('‚úÖ Usando veh√≠culo directo de factura:', factura.vehiculo);
    return {
      ...factura.vehiculo,
      origen: 'factura_directa'
    };
  }
  
  // PRIORIDAD 2: Veh√≠culo de la orden (para facturas desde √≥rdenes)
  if (factura.orden && factura.orden.vehiculo) {
    console.log('‚úÖ Usando veh√≠culo de orden:', factura.orden.vehiculo);
    return {
      ...factura.orden.vehiculo,
      origen: 'orden'
    };
  }
  
  // PRIORIDAD 3: Veh√≠culo en propiedad "vehiculo" de la factura
  if (factura.vehiculo !== undefined && factura.vehiculo !== null) {
    console.log('‚úÖ Veh√≠culo en propiedad vehiculo:', factura.vehiculo);
    return {
      ...factura.vehiculo,
      origen: 'factura_prop'
    };
  }
  
  console.log('‚ùå No se encontr√≥ veh√≠culo en la factura');
  return null;
};

/* =====================================================
   FACTURA SIMPLIFICADA (NORMAL)
===================================================== */

const determinarTipo = (detalle: any): string => {
  // Si ya tiene tipo definido, usarlo
  if (detalle.tipo) {
    return detalle.tipo.toLowerCase();
  }
  
  // Si tiene productoId, es producto
  if (detalle.productoId) {
    return 'producto';
  }
  
  // Si tiene servicioId, es servicio
  if (detalle.servicioId) {
    return 'servicio';
  }
  
  // Intentar determinar por descripci√≥n
  return determinarTipoItem(detalle.descripcion || '');
};

// üî• MISMA FUNCI√ìN DE DETERMINAR TIPO POR DESCRIPCI√ìN
function determinarTipoItem(descripcion: string): string {
  const desc = descripcion.toLowerCase();
  
  // Palabras clave para servicios
  const keywordsServicios = [
    'servicio', 'mantenimiento', 'reparaci√≥n', 'diagn√≥stico', 'alineaci√≥n',
    'balanceo', 'cambio', 'revisi√≥n', 'instalaci√≥n', 'montaje', 'desmontaje',
    'limpieza', 'ajuste', 'calibraci√≥n', 'sincronizaci√≥n', 'prueba', 'test',
    'mano de obra', 'labor', 'trabajo', 'inspecci√≥n', 'chequeo', 'control',
    'evaluaci√≥n', 'an√°lisis', 'medici√≥n', 'verificaci√≥n'
  ];
  
  // Palabras clave para productos
  const keywordsProductos = [
    'filtro', 'aceite', 'buj√≠a', 'pastilla', 'disco', 'neum√°tico', 'llanta',
    'bater√≠a', 'amortiguador', 'bomba', 'correa', 'manguera', 'fusible',
    'bombillo', 'l√°mpara', 'sensor', 'pieza', 'repuesto', 'kit', 'juego',
    'refacci√≥n', 'accesorio', 'herramienta', 'material', 'lubricante',
    'aditivo', 'freno', 'embrague', 'radiador', 'alternador', 'motor',
    'caja', 'transmisi√≥n', 'escape', 'suspensi√≥n'
  ];
  
  // Buscar palabras clave de servicios
  for (const keyword of keywordsServicios) {
    if (desc.includes(keyword)) return 'servicio';
  }
  
  // Buscar palabras clave de productos
  for (const keyword of keywordsProductos) {
    if (desc.includes(keyword)) return 'producto';
  }
  
  return 'producto'; // Por defecto
}

// üî• MISMA FUNCI√ìN PARA FORMATEAR M√âTODO DE PAGO
function formatearMetodoPago(metodo: string): string {
  const metodos: Record<string, string> = {
    'EFECTIVO': 'Efectivo',
    'TARJETA_CREDITO': 'Tarjeta de Cr√©dito',
    'TARJETA_DEBITO': 'Tarjeta de D√©bito',
    'TRANSFERENCIA': 'Transferencia',
    'CHEQUE': 'Cheque',
    'OTRO': 'Otro',
    'CONTADO': 'Contado'
  };
  
  const metodoUpper = metodo.toUpperCase();
  return metodos[metodoUpper] || metodo;
}

